/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER Disp_aumentoPersonal

 AFTER INSERT ON empleados

 FOR EACH ROW 

 UPDATE  ubicaciones SET num_empleados = (						

											SELECT COUNT(empleados.id)

											FROM empleados,departamentos,(SELECT * FROM ubicaciones ) as alias

											WHERE empleados.idDepartamento=departamentos.id

											AND departamentos.idUbicaciones=alias.id 

											AND alias.nombre LIKE ( 

																	  SELECT alias.nombre

																	  FROM empleados,departamentos,(SELECT * FROM ubicaciones ) as alias

																	  WHERE empleados.idDepartamento=departamentos.id

																	  AND departamentos.idUbicaciones=alias.id

																	  AND empleados.idDepartamento = NEW.idDepartamento

																	  GROUP BY alias.nombre

																	  )

											) 

	WHERE ubicaciones.nombre LIKE ( 

									SELECT alias.nombre

									FROM empleados,departamentos,(SELECT * FROM ubicaciones ) as alias

									WHERE empleados.idDepartamento=departamentos.id

									AND departamentos.idUbicaciones=alias.id

									AND empleados.idDepartamento = NEW.idDepartamento

									GROUP BY alias.nombre

									) */;;

